  [],\n\t\"revision_timestamp\": \"2015-05-07T14:30:36.766126\",\n\t\"name\": \"low-power-self-calibrated-vector-magnetometer-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This Phase I SBIR project investigates a
  novel approach to vector magnetometry based on high precision measurements of the
  total magnetic field.  The calibration is based on the measurement of the Larmor
  frequency of an atomic vapor.  The accuracy should be sufficient to determine the
  curl of the magnetic field from measurement points separated by about 80 meters.
  \ A novel magnetic modulation technique will be compared to the technique used in
  Cassini and Ulysses.  Two methods for controlling the atomic density will be compared.
